CREATE DATABASE IF NOT EXISTS smart_energy;
USE smart_energy;

CREATE TABLE energy_data (
    id INT AUTO_INCREMENT PRIMARY KEY,
    tijdstip DATETIME NOT NULL,
    zonnepaneelspanning DECIMAL(8,2),
    zonnepaneelstroom DECIMAL(10,6),
    waterstofproductie DECIMAL(10,6),
    stroomverbruik_woning DECIMAL(10,6),
    waterstofverbruik_auto DECIMAL(10,6),
    buitentemperatuur DECIMAL(5,2),
    binnentemperatuur DECIMAL(5,2),
    luchtdruk DECIMAL(7,3),
    luchtvochtigheid DECIMAL(5,2),
    accuniveau DECIMAL(5,2),
    co2_concentratie DECIMAL(7,3),
    waterstofopslag_woning DECIMAL(5,2),
    waterstofopslag_auto DECIMAL(5,2),
    created_at TIMESTAMP DEFAULT CURRENT_TIMESTAMP
);

